const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');

const slider = document.getElementById('resolution');
const sliderLabel = document.getElementById('resolutionLabel');
slider.addEventListener('change', handleSlider);

const image1 = new Image();
image1.src = 'data:image/jpeg;base64,';

class Cell {
  constructor(x, y, symbol, color) {
    this.x = x;
    this.y = y;
    this.symbol = symbol;
    this.color = color;
  }

  draw(ctx) {
    // ctx.fillStyle = 'white';
    // ctx.fillText(this.symbol, this.x + 0.5, this.y + 0.5);
    ctx.fillStyle = this.color;
    ctx.fillText(this.symbol, this.x, this.y);
  }
}

class AsciiEffect {
  imageCellArray = [];
  pixels = [];
  ctx;
  width;
  height;

  constructor(ctx, width, height) {
    this.ctx = ctx;
    this.width = width;
    this.height = height;
    this.ctx.drawImage(image1, 0, 0, this.width, this.height);
    this.pixels = this.ctx.getImageData(0, 0, this.width, this.height);
  }

  convertToSymbol(averageColorValue) {
    if (averageColorValue > 250) return 'A';
    else if (averageColorValue > 240) return 'B';
    else if (averageColorValue > 220) return 'C';
    else if (averageColorValue > 200) return 'D';
    else if (averageColorValue > 180) return 'E';
    else if (averageColorValue > 160) return 'F';
    else if (averageColorValue > 140) return 'G';
    else if (averageColorValue > 120) return 'H';
    else if (averageColorValue > 100) return 'I';
    else if (averageColorValue > 80) return 'J';
    else if (averageColorValue > 60) return 'K';
    else if (averageColorValue > 40) return 'L';
    else if (averageColorValue > 20) return 'M';
    else return 'N';
  }

  scanImage(cellSize) {
    this.imageCellArray = [];
    for (let y=0; y < this.pixels.height; y += cellSize) {
      for (let x=0; x < this.pixels.width; x += cellSize) {
        const posX = x * 4;
        const posY = y * 4;
        const pos = (posY * this.pixels.width) + posX;
        if (this.pixels.data[pos + 3] > 128) {
          const red = this.pixels.data[pos];
          const green = this.pixels.data[pos + 1];
          const blue = this.pixels.data[pos + 2];
          const total = red + green + blue;
          const averageColorValue = total/3;
          const color = 'rgb(' + red + ',' + green + ',' + blue + ')';
          const symbol = this.convertToSymbol(averageColorValue);
          this.imageCellArray.push(new Cell(x, y, symbol, color));
        }
      }
    }
    console.log(this.imageCellArray);
  }

  drawAscii() {
    this.ctx.clearRect(0, 0, this.width, this.height);
    for (let i=0; i < this.imageCellArray.length; i++) {
      this.imageCellArray[i].draw(this.ctx);
    }
  }

  draw(cellSize) {
    this.scanImage(cellSize);
    this.drawAscii();
  }
}

let effect;

image1.onload = () => {
  canvas.width = image1.width;
  canvas.height = image1.height;
  effect = new AsciiEffect(ctx, image1.width, image1.height);
  ctx.drawImage(image1, 0, 0, image1.width, image1.height);
}


function handleSlider() {
  console.log(slider.value);
  if (parseInt(slider.value) === 1) {
    sliderLabel.innerHTML = 'Original Image';
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
  }
  else {
    sliderLabel.innerHTML = 'Resolution: ' + slider.value + 'px';
    // ctx.font = parseInt(slider.value) * 1.2 + 'px Verdana';
    effect.draw(parseInt(slider.value));
  }
}